    data: |
      SELECT DISTINCT - ( cor0.col1 ) + 92 AS col2 FROM tab2 (FORMAT parquet), tab0 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab2

outputs:
  - name: q6162.out
    data: |
      -5
      1
      6
